    expect(queryAllByTestId(document.body, "lang-name")[1]).toHaveTextContent(
      "javascript 200.0 B",
    );

    expect(queryAllByTestId(document.body, "lang-name")[2]).toHaveTextContent(
      "css 100.0 B",
    );
  })

